// import logo from "./logo.svg";
import "./App.css";
import data from "./users.json";

function userGender() {
    return(
        data.map((user) => {
            return(
                <div className='box' key={user.id}>

                        <p>
                            {user.first_name} {user.last_name} ({user.gender})
                        </p>
                    </div>

            )
        })
    )
}

export default userGender;
